import React, { Component } from 'react'
import Navbar from '../pages/Navbar'
import Body_Apropos from '../pages/Body_Apropos'

export class Apropos extends Component {
  render() {
    return (
      <div>
        <Navbar />
        <Body_Apropos />
      </div>
    )
  }
}

export default Apropos
